# Counts leading digits.
def lead_count(data, local_result):
    for entry in data:
        entry_str = str(entry)
        # Check entry is not empty.
        if entry_str:
            # Get leading digit.
            lead_digit = entry_str[0]
            if lead_digit.isdigit():
                if lead_digit in local_result:
                    local_result[lead_digit] += 1
                else:
                    local_result[lead_digit] = 1


def main():
    # List to store results from all threads.
    thread_results = []

    # Number of threads.
    num_threads = 4
    chunk_size = len(IncomeDf) // num_threads

    # Create threads and start.
    threads = []
    for i in range(num_threads):
        # Chunk data to be processed.
        start_index = i * chunk_size
        # Last thread gets remaining data.
        end_index = (i + 1) * chunk_size if i < num_threads - 1 else len(IncomeDf)

        thread_data = IncomeDf[start_index:end_index]
        # Dictionary to store result of this thread.
        local_result = {}
        thread_results.append(local_result)

        thread = threading.Thread(target=lead_count, args=(thread_data, local_result))
        threads.append(thread)
        thread.start()

    # Wait for all threads to finish.
    for thread in threads:
        thread.join()

    # Combine all results.
    final_result = {}
    for local_result in thread_results:
        for digit, count in local_result.items():
            if digit in final_result:
                final_result[digit] += count
            else:
                final_result[digit] = count

    # Calculate total counts and percentages.
    total_counts = sum(final_result.values())
    percentages = {digit: (count / total_counts) for digit, count in final_result.items()}

    # Determine most and least frequent digits.
    most_frequent_digit = max(final_result, key=final_result.get)
    least_frequent_digit = min(final_result, key=final_result.get)

    # Display results.
    print("digit %")
    for digit in sorted(percentages.keys(), key=int):
        print(f"{digit}    {percentages[digit]}")

    print(f"Most Freq starting digit: {most_frequent_digit}")
    print(f"Least Freq starting digit: {least_frequent_digit}")


# Run main routine.
if __name__ == '__main__':
    main()